import React from "react";

import PropTypes from 'prop-types';

import { Box, useTheme } from "@mui/material";
import { ResponsiveBar } from "@nivo/bar";
import { tokens } from "../theme";
// import { mockBarData as data } from "../data/mockData";


const BarChart = ({ isDashboard = false }) => {

  const theme = useTheme();
  const colors = tokens(theme.palette.mode);

  const data = [
    {
      "country": "AD",
      "hot dog": 185,
      "hot dogColor": "hsl(175, 70%, 50%)",
      "burger": 138,
      "burgerColor": "hsl(344, 70%, 50%)",
      "sandwich": 176,
      "sandwichColor": "hsl(171, 70%, 50%)",
      "kebab": 172,
      "kebabColor": "hsl(333, 70%, 50%)",
      "fries": 157,
      "friesColor": "hsl(30, 70%, 50%)",
      "donut": 112,
      "donutColor": "hsl(112, 70%, 50%)"
    },
    {
      "country": "AE",
      "hot dog": 183,
      "hot dogColor": "hsl(237, 70%, 50%)",
      "burger": 122,
      "burgerColor": "hsl(239, 70%, 50%)",
      "sandwich": 103,
      "sandwichColor": "hsl(53, 70%, 50%)",
      "kebab": 148,
      "kebabColor": "hsl(226, 70%, 50%)",
      "fries": 168,
      "friesColor": "hsl(198, 70%, 50%)",
      "donut": 38,
      "donutColor": "hsl(56, 70%, 50%)"
    },
    {
      "country": "AF",
      "hot dog": 145,
      "hot dogColor": "hsl(173, 70%, 50%)",
      "burger": 104,
      "burgerColor": "hsl(347, 70%, 50%)",
      "sandwich": 83,
      "sandwichColor": "hsl(102, 70%, 50%)",
      "kebab": 191,
      "kebabColor": "hsl(174, 70%, 50%)",
      "fries": 115,
      "friesColor": "hsl(183, 70%, 50%)",
      "donut": 97,
      "donutColor": "hsl(188, 70%, 50%)"
    },
    {
      "country": "AG",
      "hot dog": 73,
      "hot dogColor": "hsl(354, 70%, 50%)",
      "burger": 67,
      "burgerColor": "hsl(16, 70%, 50%)",
      "sandwich": 191,
      "sandwichColor": "hsl(251, 70%, 50%)",
      "kebab": 120,
      "kebabColor": "hsl(314, 70%, 50%)",
      "fries": 74,
      "friesColor": "hsl(61, 70%, 50%)",
      "donut": 104,
      "donutColor": "hsl(214, 70%, 50%)"
    },
    {
      "country": "AI",
      "hot dog": 41,
      "hot dogColor": "hsl(146, 70%, 50%)",
      "burger": 187,
      "burgerColor": "hsl(308, 70%, 50%)",
      "sandwich": 145,
      "sandwichColor": "hsl(136, 70%, 50%)",
      "kebab": 18,
      "kebabColor": "hsl(34, 70%, 50%)",
      "fries": 32,
      "friesColor": "hsl(80, 70%, 50%)",
      "donut": 198,
      "donutColor": "hsl(157, 70%, 50%)"
    },
    {
      "country": "AL",
      "hot dog": 29,
      "hot dogColor": "hsl(76, 70%, 50%)",
      "burger": 37,
      "burgerColor": "hsl(10, 70%, 50%)",
      "sandwich": 121,
      "sandwichColor": "hsl(296, 70%, 50%)",
      "kebab": 41,
      "kebabColor": "hsl(23, 70%, 50%)",
      "fries": 71,
      "friesColor": "hsl(169, 70%, 50%)",
      "donut": 66,
      "donutColor": "hsl(14, 70%, 50%)"
    },
    {
      "country": "AM",
      "hot dog": 139,
      "hot dogColor": "hsl(119, 70%, 50%)",
      "burger": 90,
      "burgerColor": "hsl(31, 70%, 50%)",
      "sandwich": 53,
      "sandwichColor": "hsl(165, 70%, 50%)",
      "kebab": 15,
      "kebabColor": "hsl(169, 70%, 50%)",
      "fries": 196,
      "friesColor": "hsl(36, 70%, 50%)",
      "donut": 199,
      "donutColor": "hsl(314, 70%, 50%)"
    }
  ]

  const MyResponsiveBar = ({ data }) => (
    <ResponsiveBar
        data={data}
        keys={[
            'hot dog',
            'burger',
            'sandwich',
            'kebab',
            'fries',
            'donut'
        ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40
        }}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        legends={[
            {
                dataFrom: 'keys',
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 120,
                translateY: 0,
                itemsSpacing: 2,
                itemWidth: 100,
                itemHeight: 20,
                itemDirection: 'left-to-right',
                itemOpacity: 0.85,
                symbolSize: 20,
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
        role="application"
        ariaLabel="Nivo bar chart demo"
        barAriaLabel={function(e){return e.id+": "+e.formattedValue+" in country: "+e.indexValue}}
    />
  );

  MyResponsiveBar.propTypes = {
    data: PropTypes.object.isRequired
  }

  return (
      <MyResponsiveBar data={data} />
  );
};

export default BarChart;
